(lib.init = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		this.play();
	}
	this.frame_1 = function() {
		var num_puntos = 100;
		var num_cuerdas = 6;
		var v_puntos = 3;
		var array_puntos = [];
		var mouseYant =1;
		this.stop();
		this.linea.removeEventListener('tick', controlaLinea);
		this.linea.addEventListener('tick', controlaLinea);
		stage.on('stagemousemove', mouseMove, false);
		
		var particulas = new createjs.Shape();
		var ondas = new createjs.Shape();
		this.linea.removeAllChildren();
		this.linea.addChild(particulas);
		this.linea.addChild(ondas);
		var contador_frames = 0;
		var mouseX=0, mouseY=0;
		var esto = this;
		function controlaLinea(){
			contador_frames++;
			var stroke_color = "#ffffff";
			particulas.graphics.clear();
			pinta_particulas();
			
		}
		function inicializar(){
			for(var i=0; i<num_puntos; i++){
				var punto = {x: (i+1)*(800/num_puntos)-409, y:0, vx:0, vy:0, refx: 0, refy:0};
				array_puntos[i] = punto;
			
			}
			num_elemento = 3;
				array_puntos[num_elemento].y = 50
				array_puntos[num_elemento].vy =0;
			
		}
		var num_elemento = 0;
		function pinta_particulas(){
			
			if(mouseY/Math.abs(mouseY) != mouseYant/Math.abs(mouseYant)){
				//console.log("Genera onda");
				mouseYant = mouseY;
				num_elemento = Math.round( num_puntos * (mouseX +600)/1200 );
				//console.log(mouseX);
				array_puntos[num_elemento].y = mouseY*3;
				array_puntos[num_elemento].y = Math.max(-280, Math.min(280, array_puntos[num_elemento].y));
				array_puntos[num_elemento].vy =0;
			}
			for(var i=num_puntos-1; i>=0; i--){
				
				array_puntos[i].vy += (0 - array_puntos[i].y)/37;
				array_puntos[i].vy = array_puntos[i].vy*0.95;
				array_puntos[i].y += array_puntos[i].vy;
				if (i<num_puntos-1){
					if (Math.abs(array_puntos[i+1].y) < Math.abs(array_puntos[i].y)){
						array_puntos[i+1].y = array_puntos[i].y*0.93;
					}
				}
				if (i>0){
					if (Math.abs(array_puntos[i-1].y) < Math.abs(array_puntos[i].y)){
						array_puntos[i-1].y = array_puntos[i].y*0.93;
					}
				}
			}
			particulas.graphics.beginStroke("#ffffff");
			for(var j = 0; j<num_cuerdas; j++){
				particulas.graphics.moveTo(-600, 0).lineTo(-400, 0);
				for(var i=1; i<num_puntos-1; i++){
					var multiplicador = j/num_cuerdas *30 *Math.min(1,contador_frames/100 ) ;
					var y_nueva = (array_puntos[i].y+multiplicador) * Math.sin(Math.PI * i /num_puntos );
					array_puntos[i].refy = (array_puntos[i].refy + array_puntos[i+1].refy + array_puntos[i-1].refy)/3
					
					particulas.graphics.lineTo( (array_puntos[i].x - (array_puntos[i].refy/10)*j), array_puntos[i].refy   );
					array_puntos[i].refy = y_nueva;
				}
				particulas.graphics.lineTo(600, 0);
			}
		
		}
		inicializar();
		
				mouseX=-600;
				mousey=-1;
		function mouseMove(e){
		
		    if(e.stageX) {
		        mouseX = e.stageX-600;
		        mouseY = e.stageY-300;
		    } 
		    /* do something with mouseX/mouseY */
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1).call(this.frame_1).wait(1));

	// Capa 3
	this.linea = new lib.linea();
	this.linea._off = true;

	this.timeline.addTween(cjs.Tween.get(this.linea).wait(1).to({_off:false},0).wait(1));

	// Capa 1
	this.txt_data = new lib.txt_data_understand();
	this.txt_data.setTransform(-1.1,-6.7);
	this.txt_data._off = true;

	this.timeline.addTween(cjs.Tween.get(this.txt_data).wait(1).to({_off:false},0).wait(1));

}).prototype = p = new cjs.MovieClip();
